import {
    SET_AVATAR_USERS,
    SET_DAYOFBIRTH_USERS,
    SET_FULLNAME_USERS,
    SET_GMAIL_USERS,
    SET_TOKEN_USERS
} from './type';

export function setAvatar__Users(file: File[]){
    return {
        type:SET_AVATAR_USERS,
        payload: file
    };
}

export function setDateofbirth__Users(dob:string){
    return {
        type:SET_DAYOFBIRTH_USERS,
        payload: dob
    };
}

export function setFullname__Users(fname: string){
    return {
        type:SET_FULLNAME_USERS,
        payload: fname
    };
}

export function setGmail__Users(gmail:string){
    return {
        type:SET_GMAIL_USERS,
        payload: gmail
    };
}

export function setToken__Users(token: string){
    return {
        type:SET_TOKEN_USERS,
        payload: token
    };
}
